import Login from './Login';
import Signin from './Signin';
import HomePage from './HomePage';
import PageProfil from './PageProfil';
import EditerProfil from './EditerProfil';

const PAGES = {
  HOME: 'home',
  PROFILE: 'profile',
  EDIT_PROFILE: 'edit_profile',
  SIGNIN: 'signin',
};

export default function NavigationPanel(props) {
  return (
    <nav>
      <ul>
        {props.isConnected ? (
          <>
            <li>
              <a
                href="#"
                onClick={() => props.setCurrentPage(PAGES.HOME)}
                className={props.currentPage === PAGES.HOME ? 'active' : ''}
              >
                Accueil
              </a>
            </li>
            <li>
              <a
                href="#"
                onClick={() => props.setCurrentPage(PAGES.PROFILE)}
                className={props.currentPage === PAGES.PROFILE ? 'active' : ''}
              >
                Profil
              </a>
            </li>
            <li>
              <a
                href="#"
                onClick={() => props.setCurrentPage(PAGES.EDIT_PROFILE)}
                className={
                  props.currentPage === PAGES.EDIT_PROFILE ? 'active' : ''
                }
              >
                Editer profil
              </a>
            </li>
            <li>
              <a href="#" onClick={props.logout}>
                DÃ©connexion
              </a>
            </li>
          </>
        ) : (
          <li>
            <a
              href="#"
              onClick={() => props.setCurrentPage(PAGES.SIGNIN)}
              className={props.currentPage === PAGES.SIGNIN ? 'active' : ''}
            >
              Inscription
            </a>
          </li>
        )}
      </ul>
    </nav>
  );
}
